INSERT INTO `mfp_classes` VALUES (38,'GO','Общее назначение','Для детей','Дети любят рисовать на компьютере, а кое-что достойно перевода на бумагу.\n\n<strong>Рекомендуемые категории продуктов:</strong><ul><li>Недорогой цветной струйник (примерно, до 8 тыс. руб.)</li><li>Если рисунков много, то выгоднее будет приобрести несколько более дорогой принтер (до 10–12 тыс. руб) с бОльшими контейнерами для чернил.</li></ul>\nЕсли для рисования используется планшет, желательно, чтобы принтер поддерживал Wi-Fi.','Kids'),(41,'GO','Фото','Для печати фото (любительский)','Печать и копирование фотографий и оцифровка альбомов старых снимков в любительском качестве\n\n<strong>Рекомендуемые категории продуктов:</strong>\n<ul><li>Цветной струйный принтер 4–6 цветов.</li><li>Для черно-белой фотографии – монохромный струйник.</li></ul>','Photo_entry'),(42,'GO','Фото','Для печати фото (профессиональный)','Печать фотографий в высоком качестве \n<strong>Рекоммендуется:</strong> Струйный принтер 6 и более цветов формата А3+','Photo_pro'),(43,'GO','Коммерческий','Для офиса с умеренной печатью','Печать, копирование, сканирование черно-белое или цветное в форматах А4 или А3.\n<strong>Рекомендуемые категории продуктов:</strong>\n<ul><li>Черно-белый лазерный или струйный принтер/МФУ для рабочих групп с дуплексом и сетевым интерфейсом, формата А4 или А3.</li><li>Цветной офисный струйник с дуплексом и сетью</li><li>Цветной лазерный принтер/МФУ начальной или средней производительности.</li></ul>','Office_min'),(44,'GO','Коммерческий','Для офиса с интенсивной печатью','Регулярные печать и копирование большого объема документов \n<strong>Рекомендуются:</strong> Высокопроизводительные лазерные и струйные принтеры или МФУ ','Office_max'),(45,'CL','Тип аппарата','Принтер','Только принтер','Printer'),(46,'CL','Тип аппарата','Настольный МФУ','Многофункциональное устройство формата A4','MFP_desktop'),(47,'CL','Технология печати','Лазерный','','Laser'),(49,'CL','Цвет','Черно-белый','','Mono'),(50,'CL','Цвет','Цветной','','Color'),(51,'CL','','Высокопроизводительный','Высокая скорость печати','Perfomance'),(52,'CL','Коммуникации','Wi-Fi','Возможность беспроводного подключения','WiFi'),(53,'GO','Общее назначение','Для учащихся','Школьники и студенты могут распечатывать материалы из Сети, копировать или оцифровывать конспекты, квитанции, справки и т.д.\n\n<strong>Рекомендуемые категории продуктов:</strong><ul><li>Лучше всего для этого подходят недорогие черно/белые лазерные МФУ.</li><li>Если печатать/копировать часто и много, подойдут монохромные струйные МФУ.</li><li>Если только печатать – дешевле обойдутся черно/белые принтеры.</li></ul> \nСкорость печати - до 30 стр/мин.','Schoolers_students'),(54,'GO','Общее назначение','Для домашних дел','Для дома лучше всего подходят недорогие черно/белые лазерные МФУ. \n<ul><li>Лучше всего для этого подходят недорогие черно/белые лазерные МФУ.</li><li>Если печатать/копировать часто и много, подойдут монохромные струйные МФУ.</li><li>Если только печатать – дешевле обойдутся черно/белые принтеры.</li></ul> \nСкорость печати - до 30 стр/мин.','Home'),(55,'GO','Коммерческий','Для малого и домашнего офиса','Печать, копирование, сканирование материалов в форматах А4 или А3.\nПри необходимости – отправка и получение факсов\n\n<strong>Рекомендуемые категории продуктов:</strong>\n<ul><li>Черно-белое лазерное или струйное МФУ, если только печать – принтер.</li><li>Недорогой цветной лазерный принтер или МФУ</li></ul>','SOHO'),(56,'CL','Технология печати','Струйный','','Ink');
